/* tslint:disable */
// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmMuteControl,
  VmControl,
  VmIcon,
  VmTooltip 
} from '@vime/core';

import { define } from '../lib';


define('vm-mute-control', VmMuteControl);
define('vm-control', VmControl);
define('vm-icon', VmIcon);
define('vm-tooltip', VmTooltip);


export interface MuteControlProps extends JSX.VmMuteControl, HTMLAttributes<HTMLVmMuteControlElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmMuteControlElement, MuteControlProps>(
  'vm-mute-control',
  new Set(['lowVolumeIcon','highVolumeIcon','mutedIcon','icons','tooltipPosition','tooltipDirection','hideTooltip','keys','volume','muted','i18n']),
);
